import React from 'react';
import './App.css';
import { Route } from 'react-router-dom';
// Components
import Header from './components/header/Header';
import RecipeList from './components/recipe/RecipeList';

function App() {
  return (
    <div className="App">
      <Header />
      <Router exact path='/' component={RecipeList} />
      {/* <RecipeList /> */}
    </div>
  )
}

export default App;
